import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Views from '../views/index';
const Home = Views.Home();

export function RoutesPag(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={Home}/>
                <Route path="*" element={
                    <h1>ERROR 404</h1>
                }/>
            </Routes>
        </BrowserRouter>
    );
};
